text:
Que tal preparar um delicioso brownie para comer com a família no lanche da tarde? O passo a passo é bem simples e fácil de fazer.

Com 5 ingredientes fáceis de encontrar, a receita é perfeita para encantar a sua família.

Ingredientes

Receita fácil de brownie de chocolate

2 xícaras de achocolatado em pó

1 xícara de farinha de trigo

1 xícara de açúcar

200 gramas de manteiga

4 ovos

Modo de Preparo

Receita fácil de brownie de chocolate

1Em uma tigela, coloque os ovos, o açúcar e bata com a ajuda de um fouet ou garfo;

2Em seguida, adicione a manteiga e o achocolatado em pó;

3Misture tudo e depois adicione a farinha de trigo;

4Mexa a massa até que fique homogênea;

5Depois, despeje a massa em uma forma untada com achocolatado em pó;

6Leve para assar em forno preaquecido a 180 graus Celsius por 35 minutos;

7Retire do forno e sirva

